import React, { Component } from 'react';

class Contact extends Component {
  state = { contact: 'india' };
  render() {
    return (
      <div>
        <h4>Select Your Region : </h4>
        <button className="btn btn-dark" onClick={this.onRegionChange('india')}>
          India
        </button>
        <button className="btn btn-dark" onClick={this.onRegionChange('usa')}>
          USA
        </button>
      </div>
    );
  }
}

export default Contact;
